import React from 'react'
import { Link } from 'react-router-dom'
import styled from 'styled-components'
import { RiCheckboxCircleLine } from "react-icons/ri"




const CoachingServices = () => {

  return (
    <Wrapper>
      <div className='section-center'>
        <div className='title'>
          <h2>Individualized Services</h2>
          <div className='underline'></div>
        </div>
        <div className='services-center'>

          <article className='service'>
            <h4>Individualized training program</h4>
<p>
Individualized programs are built based on an extensive anlysis of your goals, needs and training background to create the best program for YOU.
</p>
<p>
This option suits beginner, intermediate and advanced lifters that wants to get the most out of their training.
</p>
<p>
We start by analyzing your technique and needs before writing the program, we will also have a check-in when the program is finished to evaluate the program.
</p>
            <ul>
              <li>
                <p>
                  <RiCheckboxCircleLine /> Fully Individualized Program
              </p>
              </li>
              <li>
                <p>
                  <RiCheckboxCircleLine /> Any lenght(Min. 6 weeks)
              </p>
              </li>
              <li>
                <p>
                  <RiCheckboxCircleLine /> Check ins after 1st and last week
              </p>
              </li>
            </ul>
            <Link to='/contact' className='btn'>
              Get Started
      </Link>
          </article>

          <article className='service'>
            <h4>All access coaching</h4>
            <p>
              We start with creating an individualized program based on an extensive anlysis of your goals, needs and training background to create the best program for YOU. Then we proceed with Week-To-Week or Month-To-Month feedback and program updates to achieve optimal performance.
</p>
            <p>
              This option is best suited for competative powerlifters who want the optimal training program.
</p>
            <p>
              Price: 699 SEK/month
            </p>
            <ul>
              <li>
                <p>
                  <RiCheckboxCircleLine /> Fully individualized program
              </p>
              </li>
              <li>
                <p>
                  <RiCheckboxCircleLine /> Weekly/monthly program updates
              </p>
              </li>
              <li>
                <p>
                  <RiCheckboxCircleLine /> Weekly feedback and support
              </p>
              </li>
            </ul>
            <Link to='/contact' className='btn'>
              Get Started
      </Link>
          </article>
        </div>
      </div>
    </Wrapper>
  )
}

const Wrapper = styled.section`
h2,
h3,
h4 {
  color: var(--clr-primary-1);
}

h3,
h4,
{
  color: var(--clr-primary-1);
}

li {
  color: var(--clr-primary-1);
padding: 1rem;
}

padding: 5rem 0;

background: var(--clr-primary-10);

.header h3 {
  margin-bottom: 2rem;
}
p {
  margin-bottom: 0;
  line-height: 1.8;
  color: var(--clr-primary-1);
}
.services-center {
  margin-top: 4rem;
  display: grid;
  gap: 2.5rem;
}
.service {
  background: var(--clr-primary-7);
  text-align: center;
  padding: 2.5rem 2rem;
  border-radius: var(--radius);
  p {
    padding: 1rem;
    color: var(--clr-primary-1);
  }
}
span {
  width: 4rem;
  height: 4rem;
  display: grid;
  margin: 0 auto;
  place-items: center;
  margin-bottom: 1rem;
  border-radius: 50%;
  background: var(--clr-primary-10);
  color: var(--clr-primary-1);
  svg {
    font-size: 2rem;
  }
}
@media (min-width: 992px) {
  .header {
    display: grid;
    grid-template-columns: 1fr 1fr;
  }
}
@media (min-width: 750px) {
  .services-center {
    grid-template-columns: repeat(2, minmax(200px, 1fr));
  }
}
@media (min-width: 1280px) {
  padding: 0;
  .section-center {
    transform: translateY(5rem);
  }
}
`

export default CoachingServices
